import React from "react";

export default function Navbar() {
  return (
    <div className="nav-bar">
      <h1 className="title">Startup 3</h1>
      <ul className="nav-bar1">
        <li>Overview</li>
        <li>Prices</li>
        <li>Blog</li>
        <li>Feedback</li>
        <button>Purchase</button>
      </ul>
    </div>
  );
}
